/** 
 * Constructor using a Notification object and a notificationId to get a handle on the Notification in order to update it.
 * @param context        Context to use in the AppWidgetManager initialization.
 * @param remoteViews    RemoteViews object which contains the ImageView that will load thebitmap.
 * @param viewId         The id of the ImageView view that will load the image.
 * @param width          Desired width of the bitmap that will be loaded.(Need to be manually putbecause of RemoteViews limitations.)
 * @param height         Desired height of the bitmap that will be loaded. (Need to be manuallyput because of RemoteViews limitations.)
 * @param notification   The Notification object that we want to update.
 * @param notificationId The notificationId of the Notification that we want to load the Bitmap.
 */
public NotificationTarget(Context context,RemoteViews remoteViews,int viewId,int width,int height,Notification notification,int notificationId){
  super(width,height);
